import './App.css';

// Button 

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <video className="video"controls muted>
        <source src="http://localhost:4000/video" type="video/mp4"></source>
        </video>
        <br></br>
        <br></br>
        <br></br>
        <table className="buttons">
          <tr>
            <td><button type="button" className="btn">ON</button></td>
            <td><button type="button" className="btn">OFF</button></td>
          </tr>
        </table>
      </header>
    </div>
  );
}

export default App;
